export const postTheme = async (data, token) => {
  const res = await fetch('http://localhost:8000/theme/create/', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      'Authorization': `Token ${token}`
    },
    body: JSON.stringify(data),
  });
  return await res.json();
};
